# This test simply converts some SUP to CSUP then runs it through 
# the vector cache to exercise the logic that builds values from 
# cached vectors.
script: |
  super -f csup -o test.csup -
  super dev vector copy -s test.csup

inputs:
  - name: stdin
    data: &input |
      1(int64|string)
      "foo"(int64|string)

outputs:
  - name: stdout
    data: *input
